import React from 'react';
import {HomeButton} from '../components/buttons/Buttons';
import { ActivityName, ActivityDescription, StarRating, UploadImage, UserDescription } from '../components/input/Input';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Container'

const MakePost = () => {
    return (
        <Container fluid>
            <Row>
            <h1>POST PAGE</h1>
            <HomeButton />
            <ActivityName />
            <ActivityDescription />
            <StarRating />
            <UploadImage />
            <UserDescription />
            </Row>
        </Container>
    )
}

export default MakePost;
